import logo from './logo.svg';
import './App.css';
import React, { useEffect, useState } from 'react';

const BASE_URL = 'http://localhost:8000'

function App() {

  const[posts, setPosts] = useState([])

  useEffect(() => {
    fetch(BASE_URL + '/blogs')
      .then(response => {
        const response_json = response.json()
        console.log(response_json);
        if (response.ok) {
          return response_json
        }
        throw response
      })
      .then(data => {
        return data.reverse()
      })
      .then(data => {
        setPosts(data)
      })
      .catch(error => {
        console.log(error);
        alert(error)
      })
  }, [])

  return (
    <div className="App">
      <title className="site_title">Blogs Site</title>
    </div>
  );
}

export default App;
